import React from "react";
import Card from "react-bootstrap/Card";

const Latest = (props) => {
  return (
    <div>
      <Card className="row" style={{ width: "13rem" }}>
        <button>
          <Card.Img
            variant="top"
            src={`https://image.tmdb.org/t/p/w185/` + props.img}
            alt="no image found"
          />
        </button>
      </Card>
    </div>
  );
};

export default Latest;
